(7, 'Goalie Stats Tab', '2011-03-29', 'Add a Goalie stats tab to the player details page. This will list general goalie stats.', 2, 3, 35),
(8, 'Request List Sorting', '2011-03-29', 'Add javascript code to allow sorting and filtering on the Request List Page', 0, 3, 35),
