(10, 'User Photo', '2011-03-29', 'Allow player photos to be uploaded for player detail page', 0, 3, 35),
(11, 'User Security', '2011-03-29', 'Allow passwords / usernames to be created', 0, 3, 35),
(12, 'Request List Clean Up', '2011-03-29', 'clean up the request list page so it looks better', 0, 3, 35),
(13, 'Request List Emailing', '2011-03-29', 'On initial creation of a request, email goes out to users with certain access level', 0, 3, 35),
(14, 'Records Page', '2011-03-29', 'Create a records page', 1, 3, 35),
(15, 'Better Security', '2011-03-29', 'Boot people out from "secured" pages if not logged in or have access levels', 0, 3, 35),
(16, 'Season Summary Pages', '2011-03-29', 'Pages to summarize a season etc. or have better navigation from season to game. ', 0, 3, 35),
(17, 'Blog Style front page', '2011-03-29', 'Allow for front page to have blog functionality to allow for regular updates', 1, 3, 35),
(18, 'Site Redesign', '2011-03-29', 'Get someone to create a style template to re-skin the site?', 0, 3, 35),
