(41, 'Spilting Stats', '2011-04-03', 'Hey Moose,\r\n\r\nI finished the season 5 and playoff stats. I notice that all the playoff stats are included in the season stats.\r\n\r\njust a heads up.\r\n\r\nThanks\r\nDavid', 1, 3, 36),
(42, 'Current Leaders', '2011-04-04', '- Best Goalie GAA\r\n- PPG/APG/GPG (Completed)', 2, 3, 35),
(43, 'New Tab', '2011-04-04', '"Career" to include goalie and player', 0, 0, 35),
(44, 'Current Leaders / Records include playoffs', '2011-04-04', 'Should this be changed?', 0, 3, 35),
(45, 'Season Totals', '2011-04-04', 'Hey Moose,\r\n\r\nI was wondering if you can reverse the look of the stats when it comes to individuals. ex:\r\n\r\nDavid Robin\r\nSeason 5\r\nSeason 4\r\nSeason 3\r\n...\r\n\r\nInstead of the newest season being at the top, can you make the newest season appear at the bottom and also can you add a total. ex:\r\n\r\nChris Lee\r\n\r\nSeason 4 = 41 goals, 41 assists, 82 points, 35 games, P.P.G.A = 2.37, record 15-20\r\nSeason 5 = 19 goals, 28 assists, 47 points, 23 games, P.P.G.A = 2.04, record 10-13\r\nSeason 6 = 16 goals, 7 assists, 23 points, 14 games, P.P.G.A = 1.64, record 5-9\r\n\r\nTOTAL = 76 goals, 76 assists, 152 points, 72 games, P.P.G.A = 2.11, record 30-42\r\n\r\n\r\nPlayoff 5 = 9 goals, 5 assists, 14 points, 6 games, P.P.G.A = 2.33, record 2-4\r\n\r\nTOTAL = 9 goals, 5 assists, 14 points, 6 games, P.P.G.A = 2.33, record 2-4\r\n\r\n\r\nCall me if you don''t understand my resquest.', 0, 3, 36),
(46, 'Player Profile', '2011-04-04', 'Hey Moose,\r\n\r\nit would be fun to have a player profile that everyone can see...\r\n\r\nstuff like\r\n----------\r\nHight:\r\nWeight:\r\nShoot:\r\nFavorite pro player\r\nFavorite pro team\r\nemail - hidden\r\nphone number - hidden\r\n\r\nJust thinking of fun things...\r\n\r\nnice work so far!!!\r\n\r\nDavid', 0, 3, 36),
(47, 'Wins/Loss and +-', '2011-04-04', 'Hey Moose,\r\n\r\njust wondering if possible to get the wins and loses for each player and goalie.\r\n\r\nex:\r\nDavid Robin - 10 wins 15 loses -5\r\nPaul Rajotte - 10 wins 10 loses Even (or 0)\r\nChris Robin - 15 Wins 10 Loses +5\r\n\r\nso it would be three extra columbs W, L, +/-\r\n\r\nThat might be tricky, just a thought.\r\n\r\nDavid', 0, 3, 36),
